css:
.nuclide-tree-root {
  margin: 0 -10px;
}
.nuclide-tree-root .nuclide-tree-component-item {
  line-height: 25px;
  padding-right: 5px;
}
.nuclide-tree-root .nuclide-tree-component-item .nuclide-tree-component-item-arrow {
  font-family: 'Octicons Regular';
  -webkit-font-smoothing: antialiased;
  width: 16px;
  display: inline-block;
  position: relative;
  top: -1px;
}
.nuclide-tree-root .nuclide-tree-component-item .icon::before {
  position: relative;
  top: 1px;
}
.nuclide-tree-root .nuclide-tree-component-selected {
  color: #fff;
  background-color: #4182C4;
  text-shadow: none;
}
.nuclide-tree-root .nuclide-tree-component-item-arrow-spinner {
  animation-name: spin;
  animation-duration: 700ms;
  animation-iteration-count: infinite;
  animation-timing-function: linear;
}
@keyframes spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}
